      return (
        <div>
          <nav className="navbar navbar-inverse">
            <div className="container-fluid">
              <a className="navbar-brand">Props</a>
            </div>
          </nav>
          <div className="container">
            <div className="row">
              <div className="col-xs-12 col-sm-12 col-md-12 col-lg-12">
                <Product
                  name="Iphone 8 64G"
                  price="15000000" 
                />
                <Product
                  name="SamSung Galaxy S8"
                  price="18000000" 
                />
                <Product
                  name="Oppo F1s"
                  price="5000000" 
                />
              </div>
            </div>
          </div>
        </div>
      );
    }
  }


export default App;
